import React from 'react';
import CourseItem from '../components/CourseItem';
import { CourseList } from "../helpers/CourseList";

function Courses() {
  return (
    <div className='courses'>
      <h1 className='courseTitle'>Courses Offered</h1>
      <div className='courseList'>
        { CourseList.map((courseItem, key) => {
          return <CourseItem image={courseItem.image} name={courseItem.name} priceHalf={courseItem.priceHalf} priceQuart={priceQuart} 
          priceHour={priceHour} />;
        })}
      </div>
    </div>
  )
}

export default Courses
